import React, { useEffect, useState } from "react";
import { Card, Image } from "semantic-ui-react";
import axios from 'axios';

export const ViewAllItems = ({ game_id }) => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    axios
    .get("/view_all_items", {
      params: {
        game_id,
      },
    })
    .then(({ data }) => {
      setItems(data.items);
    })
  }, []);

  return (
    "123"
  );
};

export default ViewAllItems;
